function gtm_product_detail(arrProduct) {
  (dataLayer = window.dataLayer || []).push({
    'ecommerce': {
      'detail': {
        'products': arrProduct
      }
    },
    'eCategory': 'eEC',
    'eAction': 'detail',
    'eLabel': '',
    'eNI': true,
    'event': 'GAEventEC'
  });
}

function gtm_product_add(params) {
  (dataLayer = window.dataLayer || []).push({
    'ecommerce': {
      'add': {
        'products': [{
          'id': params.id || '',
          'name': params.name || '',
          'price': params.price || 0.00,
          'brand': 'Kariguz',
          'category': params.section || '',
          'quantity': params.quantity || 1
        }]
      }
    },
    'eCategory': 'eEC',
    'eAction': 'cartAdd',
    'eLabel': params.listname || '',
    'eNI': false,
    'event': 'GAEventEC'
  });
}

function gtm_product_delete(params) {
  (dataLayer = window.dataLayer || []).push({
    'ecommerce': {
      'remove': {
        'products': [{
          'id': params.id || '',
          'name': params.name || '',
          'price': params.price || 0.00,
          'brand': 'Kariguz',
          'category': params.section || '',
          'quantity': params.quantity || 1
        }]
      }
    },
    'eCategory': 'eEC',
    'eAction': 'cartRemove',
    'eLabel': params.listname || '',
    'eNI': false,
    'event': 'GAEventEC'
  });
}

function gtm_product_click(params) {
  (dataLayer = window.dataLayer || []).push({
    'ecommerce': {
      'click': {
        'actionField': { 'list': params.listname || '' },
        'products': [{
          'id': params.id || '',
          'name': params.name || '',
          'price': params.price || 0.00,
          'brand': 'Kariguz',
          'list': params.section || '',
          'position': params.position || 1
        }]
      }
    },
    'eCategory': 'eEC',
    'eAction': 'productClick',
    'eLabel': params.listname || '',
    'eNI': false,
    'event': 'GAEventEC'
  });
}

function gtm_cart_checkout(arrProduct) {
  (dataLayer = window.dataLayer || []).push({
    'ecommerce': {
      'checkout': {
        'actionField': '',
        'products': arrProduct
      }
    },
    'eCategory': 'eEC',
    'eAction': 'checkout',
    'eLabel': '',
    'eNI': true,
    'event': 'GAEventEC'
  });
}
