document.addEventListener("DOMContentLoaded", function () {
  function init_more() {
    let text_more = document.querySelector('.text-more-wrap');
    if (text_more != null) {
      let min_height = parseInt(getComputedStyle(text_more).maxHeight);
      let clone = text_more.cloneNode(true);
      clone.style.width = text_more.offsetWidth + "px";
      clone.classList.add('clone_text_more');
      text_more.parentNode.appendChild(clone);

      let max_height = clone.offsetHeight + 10;
      clone.remove();
      text_more.setAttribute('data-maxheight', max_height + "px");
      text_more.classList.add('max-height', min_height + "px");

      let switch_more = text_more.parentNode.querySelector('.switch-more');
      if (switch_more != null) {
        if (max_height <= min_height) {
          switch_more.style.display = "none";
        } else {
          switch_more.style.display = "block";
          switch_more.addEventListener('click', function () {
            let text_m = this.parentNode.querySelector('.text-more-wrap');
            let trigger_check = this.parentNode.querySelector('#trigger-more:checked') != null;
            if (text_m != null) {
              if (trigger_check) {
                text_m.style.maxHeight = "";
              } else {
                text_m.style.maxHeight = text_m.getAttribute('data-maxheight');
              }
            }
          });
        }
      }

    };
  }

  init_more();
  window.addEventListener("resize", function () {
    init_more();
  });
});

